FUNCTION Start-miniExplorer
{ 

    PARAM(
        [Parameter()]
        [ValidateScript({ $($_).ToCharArray() -notcontains "." })]
        [string]$ShowFilesWithExtensionOnly
    )

    function Show-miniExplorer_psf {

        [void][reflection.assembly]::Load('System.Windows.Forms, Version=2.0.0.0, Culture=neutral, PublicKeyToken=b77a5c561934e089')
        [void][reflection.assembly]::Load('System.Data, Version=2.0.0.0, Culture=neutral, PublicKeyToken=b77a5c561934e089')
        [void][reflection.assembly]::Load('System.Drawing, Version=2.0.0.0, Culture=neutral, PublicKeyToken=b03f5f7f11d50a3a')
        [void][reflection.assembly]::Load('System.Design, Version=2.0.0.0, Culture=neutral, PublicKeyToken=b03f5f7f11d50a3a')

        [System.Windows.Forms.Application]::EnableVisualStyles()
        $formMiniExplorer = New-Object 'System.Windows.Forms.Form'
        $buttonHome = New-Object 'System.Windows.Forms.PictureBox'
        $textboxCurrentPath = New-Object 'System.Windows.Forms.TextBox'
        $buttonForward = New-Object 'System.Windows.Forms.PictureBox'
        $buttonBack = New-Object 'System.Windows.Forms.PictureBox'
        $labelCurrentPath = New-Object 'System.Windows.Forms.Label'
        $buttonOK = New-Object 'System.Windows.Forms.PictureBox'
        $buttonCancel = New-Object 'System.Windows.Forms.PictureBox'
        $listviewMain = New-Object 'System.Windows.Forms.ListView'
        $menustrip1 = New-Object 'System.Windows.Forms.MenuStrip'
        $tooltipMain = New-Object 'System.Windows.Forms.ToolTip'
        $imagelist = New-Object 'System.Windows.Forms.ImageList'
        $toolstripMain = New-Object 'System.Windows.Forms.ToolStripMenuItem'
        $viewToolStripMenuItem = New-Object 'System.Windows.Forms.ToolStripMenuItem'
        $toolstripItemListView = New-Object 'System.Windows.Forms.ToolStripMenuItem'
        $toolstripItemTileView = New-Object 'System.Windows.Forms.ToolStripMenuItem'
        $InitialFormWindowState = New-Object 'System.Windows.Forms.FormWindowState'

        FUNCTION Start-ViewDrives
        {
            $ticker = 0
            $listviewMain.Items.clear()
            $textboxCurrentPath.Text = "My Computer"
            Get-PSDrive | Where-Object { $_.Provider -match 'FileSystem' -and $_.Free -ne $null } | Select-Object Root, DisplayRoot, Description | ForEach-Object {
                $listviewMain.Items.Add($_.Root)
                $listviewMain.Items[$ticker].ImageIndex = 1
                $listviewMain.Items[$ticker].Tag = "Drive"
                $listviewMain.Items[$ticker].Name = "$($_.root)"
                $ticker += 1		
            }
        }
	
        FUNCTION Refresh-ListView
        {
            PARAM (
                [string]$path,
			
                [switch]$drive
            )
		
            IF ($drive)
            {
                Start-ViewDrives
                $formMiniExplorer.Refresh()
            }
		
            IF (-not $drive)
            {
                $counter = 0
                $exCounter = 0
                $listviewMain.Items.clear()			
                $textboxCurrentPath.Text = $($path)		
                $script:previousItem = (Get-Item $($path)).Parent.Fullname
			
                Get-ChildItem $($path) | ForEach-Object {
				
                    $objName = $_.Name
				
                    IF ($_.PSIsContainer -eq $true)
                    {
                        $listviewMain.Items.Add($objName)
                        $listviewMain.Items[$counter].ImageIndex = 0
                        $listviewMain.Items[$counter].Tag = "Folder"
                        $listviewMain.Items[$counter].Name = $($_.FullName)
                    }
				
                    IF (($_.PSIsContainer -eq $false) -and ($ShowFilesWithExtensionOnly -ne $null))
                    {
                        $theExtension = "." + $ShowFilesWithExtensionOnly
					
                        IF ($_.Extension -eq $theExtension)
                        {
                            $listviewMain.Items.Add($objName)
                            [array]$items = $listviewMain.Items
                            $zi = [array]::IndexOf($items, $objName)
                            $listviewMain.Items[$zi].Name = $($_.FullName)
                            $listviewMain.Items[$zi].Tag = "File"
                            $listviewMain.Items[$zi].ImageIndex = 2
                        }
					
                    }
				
                    IF (($_.PSIsContainer -eq $false) -and (!$ShowFilesWithExtensionOnly))
                    {
                        $listviewMain.Items.Add($objName)
                        $listviewMain.Items[$counter].ImageIndex = 2
                        $listviewMain.Items[$counter].Tag = "File"
                        $listviewMain.Items[$counter].Name = $($_.FullName)
                    }
				
                    $counter = ($counter + 1)
				
                }
            }
		
            $formMiniExplorer.Refresh()
        }
	
        FUNCTION ConvertB64-ToImage
        {
            PARAM (
                [Parameter(Mandatory = $true, Position = 0)]
                [string]$Base64String
            )
		
            TRY
            {
                Add-Type -AssemblyName System.Drawing
                $b = $Base64String
                $img = [Convert]::FromBase64String($b)
                $ms = New-Object IO.MemoryStream($img, 0, $img.Length)
                $ms.Write($img, 0, $img.Length);
                $out = [System.Drawing.Image]::FromStream($ms, $true)
			
                return $out
            }
		
            CATCH
            {
                Write-Host "The following error(s) occurred`r`n$($_)`r`nENDERROR"
            }
		
        } 
        #End functions
	
        #*
	
        # Set Icons
        #
        # Folder Icon
        [System.Drawing.Image]$FolderIcon = ConvertB64-ToImage -Base64String "" 
        # Drive Icon
        [System.Drawing.Image]$DriveIcon = ConvertB64-ToImage -Base64String "" 
        # File Icon
        [System.Drawing.Image]$FileIcon = ConvertB64-ToImage -Base64String ""
        #
        $imageList.Images.Add("folder", $FolderIcon)
        $imageList.Images.Add("Drive", $DriveIcon)
        $imageList.Images.Add("File", $FileIcon)
        #
        $listviewMain.LargeImageList = $imageList
        Refresh-ListView -drive
        # 
        # End set icons
        #*
	
        # Form load 
        $formMiniExplorer_Load = {
	
        }
	
        $listviewMain_DoubleClick = {
            IF ($listviewMain.SelectedItems[0].Tag -ne "File"){
                Refresh-ListView -path $listviewMain.SelectedItems[0].Name		
            } IF ($listviewMain.SelectedItems[0].Tag -eq "File"){
                $t = $listviewMain.SelectedItems[0].Name
                Start-Process $t
                $formMiniExplorer.Close()
            }
        }
	
        $listviewMain_Click = {
            $Global:selectedItem = $listviewMain.SelectedItems[0].Name
        }
	
        $buttonBack_Click={
            IF ($script:previousItem) { 	
                Refresh-ListView $script:previousItem 
            } ELSE { 
                Start-ViewDrives 
            }
        }
	
        $buttonOK_Click={
            $formMiniExplorer.Close()
        }
	
        $buttonCancel_Click={
            $Global:selectedItem = 'Close'
            $formMiniExplorer.Close()
        }
	
        $buttonForward_Click={
            if($listviewMain.SelectedItems){
                Invoke-Command -ScriptBlock $listviewMain_DoubleClick
            }
        }
        $toolstripItemDetailsView_Click={
            $listviewMain.View = 'Details'
        }
	
        $toolstripItemListView_Click={
            $listviewMain.View = 'List'
        }
	
        $buttonHome_Click={
            Start-ViewDrives
        }
	

        $Form_StateCorrection_Load=
        {		
            $formMiniExplorer.WindowState = $InitialFormWindowState
        }
	
        $Form_Cleanup_FormClosed=
        {
            try
            {
                $buttonHome.remove_Click($buttonHome_Click)
                $buttonForward.remove_Click($buttonForward_Click)
                $buttonBack.remove_Click($buttonBack_Click)
                $buttonOK.remove_Click($buttonOK_Click)
                $buttonCancel.remove_Click($buttonCancel_Click)
                $listviewMain.remove_Click($listviewMain_Click)
                $listviewMain.remove_DoubleClick($listviewMain_DoubleClick)
                $formMiniExplorer.remove_Load($formMiniExplorer_Load)
                $toolstripItemListView.remove_Click($toolstripItemListView_Click)
                $toolstripItemTileView.remove_Click($toolstripItemTileView_Click)
                $formMiniExplorer.remove_Load($Form_StateCorrection_Load)
                $formMiniExplorer.remove_FormClosed($Form_Cleanup_FormClosed)
            }
            catch { Out-Null <# Prevent PSScriptAnalyzer warning #> }
        }

        $formMiniExplorer.SuspendLayout()
        $menustrip1.SuspendLayout()
        #
        # formMiniExplorer
        #
        $formMiniExplorer.Controls.Add($buttonHome)
        $formMiniExplorer.Controls.Add($textboxCurrentPath)
        $formMiniExplorer.Controls.Add($buttonForward)
        $formMiniExplorer.Controls.Add($buttonBack)
        $formMiniExplorer.Controls.Add($labelCurrentPath)
        $formMiniExplorer.Controls.Add($buttonOK)
        $formMiniExplorer.Controls.Add($buttonCancel)
        $formMiniExplorer.Controls.Add($listviewMain)
        $formMiniExplorer.Controls.Add($menustrip1)
        $formMiniExplorer.AutoScaleDimensions = '6, 13'
        $formMiniExplorer.AutoScaleMode = 'Font'
        $formMiniExplorer.AutoSizeMode = 'GrowAndShrink'
        $formMiniExplorer.BackColor = 'White'
        $formMiniExplorer.ClientSize = '748, 500'
        $formMiniExplorer.Font = 'Segoe UI, 8.25pt'
        $formMiniExplorer.Icon = [System.Convert]::FromBase64String('')
        $formMiniExplorer.MainMenuStrip = $menustrip1
        $formMiniExplorer.Name = 'formMiniExplorer'
        $formMiniExplorer.Text = ' | miniExplorer'
        $formMiniExplorer.add_Load($formMiniExplorer_Load)
        #
        # buttonHome
        #
        $buttonHome.Cursor = 'Hand'        
        $buttonHome.Image = [System.Convert]::FromBase64String('')
        $buttonHome.Location = '113, 60'
        $buttonHome.Name = 'buttonHome'
        $buttonHome.Size = '43, 34'
        $buttonHome.SizeMode = 'Zoom'
        $buttonHome.TabIndex = 8
        $buttonHome.TabStop = $False
        $buttonHome.add_Click($buttonHome_Click)
        #
        # textboxCurrentPath
        #
        $textboxCurrentPath.BackColor = 'ActiveCaptionText'
        $textboxCurrentPath.BorderStyle = 'FixedSingle'
        $textboxCurrentPath.Cursor = 'Default'
        $textboxCurrentPath.Enabled = $False
        $textboxCurrentPath.Location = '88, 32'
        $textboxCurrentPath.Name = 'textboxCurrentPath'
        $textboxCurrentPath.ReadOnly = $True
        $textboxCurrentPath.Size = '644, 22'
        $textboxCurrentPath.TabIndex = 0
        #
        # buttonForward
        #
        $buttonForward.Cursor = 'Hand'
        $buttonForward.Image = [System.Convert]::FromBase64String('')
        $buttonForward.InitialImage = [System.Convert]::FromBase64String('')
        $buttonForward.Location = '56, 60'
        $buttonForward.Name = 'buttonForward'
        $buttonForward.Size = '38, 34'
        $buttonForward.SizeMode = 'Zoom'
        $buttonForward.TabIndex = 1
        $buttonForward.TabStop = $False
        $tooltipMain.SetToolTip($buttonForward, 'Forward')
        $buttonForward.add_Click($buttonForward_Click)
        #
        # buttonBack
        #
        $buttonBack.Cursor = 'Hand'
        $buttonBack.Image = [System.Convert]::FromBase64String('')
        $buttonBack.InitialImage = [System.Convert]::FromBase64String('')
        $buttonBack.Location = '12, 60'
        $buttonBack.Name = 'buttonBack'
        $buttonBack.Size = '38, 34'
        $buttonBack.SizeMode = 'Zoom'
        $buttonBack.TabIndex = 0
        $buttonBack.TabStop = $False
        $tooltipMain.SetToolTip($buttonBack, 'Backward')
        $buttonBack.add_Click($buttonBack_Click)
        #
        # labelCurrentPath
        #
        $labelCurrentPath.AutoSize = $True
        $labelCurrentPath.Font = 'Segoe UI, 9pt'
        $labelCurrentPath.Location = '5, 36'
        $labelCurrentPath.Name = 'labelCurrentPath'
        $labelCurrentPath.Size = '77, 15'
        $labelCurrentPath.TabIndex = 6
        $labelCurrentPath.Text = 'Current Path:'
        $labelCurrentPath.TextAlign = 'TopCenter'
        #
        # buttonOK
        #
        $buttonOK.Anchor = 'Top, Right'
        $buttonOK.BorderStyle = 'FixedSingle'
        $buttonOK.Cursor = 'Hand'
        $buttonOK.Image = [System.Convert]::FromBase64String('')
        $buttonOK.Location = '640, 60'
        $buttonOK.Name = 'buttonOK'
        $buttonOK.Size = '43, 34'
        $buttonOK.SizeMode = 'Zoom'
        $buttonOK.TabIndex = 5
        $buttonOK.TabStop = $False
        $tooltipMain.SetToolTip($buttonOK, 'OK')
        $buttonOK.add_Click($buttonOK_Click)
        #
        # buttonCancel
        #
        $buttonCancel.Anchor = 'Top, Right'
        $buttonCancel.BorderStyle = 'FixedSingle'
        $buttonCancel.Cursor = 'Hand'
        $buttonCancel.Image = [System.Convert]::FromBase64String('')
        $buttonCancel.Location = '689, 60'
        $buttonCancel.Name = 'buttonCancel'
        $buttonCancel.Size = '43, 34'
        $buttonCancel.SizeMode = 'Zoom'
        $buttonCancel.TabIndex = 4
        $buttonCancel.TabStop = $False
        $tooltipMain.SetToolTip($buttonCancel, 'Cancel')
        $buttonCancel.add_Click($buttonCancel_Click)
        #
        # listviewMain
        #
        $listviewMain.Anchor = 'Top, Bottom, Left, Right'
        $listviewMain.BorderStyle = 'FixedSingle'
        $listviewMain.LargeImageList = $imagelist
        $listviewMain.Location = '12, 100'
        $listviewMain.Name = 'listviewMain'
        $listviewMain.Size = '720, 390'
        $listviewMain.SmallImageList = $imagelist
        $listviewMain.TabIndex = 1
        $listviewMain.UseCompatibleStateImageBehavior = $False
        $listviewMain.add_Click($listviewMain_Click)
        $listviewMain.add_DoubleClick($listviewMain_DoubleClick)
        #
        # menustrip1
        #
        [void]$menustrip1.Items.Add($toolstripMain)
        $menustrip1.Location = '0, 0'
        $menustrip1.Name = 'menustrip1'
        $menustrip1.Size = '748, 24'
        $menustrip1.TabIndex = 7
        $menustrip1.Text = 'menustrip1'
        #
        # tooltipMain
        #
        $tooltipMain.AutomaticDelay = 10
        $tooltipMain.AutoPopDelay = 999999
        $tooltipMain.InitialDelay = 10
        $tooltipMain.ReshowDelay = 2
        $tooltipMain.ToolTipIcon = 'Info'
        #
        # imagelist
        #
        $imagelist.ColorDepth = 'Depth8Bit'
        $imagelist.ImageSize = '64, 64'
        $imagelist.TransparentColor = 'Transparent'
        #
        # toolstripMain
        #
        [void]$toolstripMain.DropDownItems.Add($viewToolStripMenuItem)
        $toolstripMain.Name = 'toolstripMain'
        $toolstripMain.Size = '35, 20'
        $toolstripMain.Text = 'File'
        #
        # viewToolStripMenuItem
        #
        [void]$viewToolStripMenuItem.DropDownItems.Add($toolstripItemListView)
        [void]$viewToolStripMenuItem.DropDownItems.Add($toolstripItemTileView)
        $viewToolStripMenuItem.Name = 'viewToolStripMenuItem'
        $viewToolStripMenuItem.Size = '152, 22'
        $viewToolStripMenuItem.Text = 'View'
        #
        # toolstripItemListView
        #
        $toolstripItemListView.Name = 'toolstripItemListView'
        $toolstripItemListView.Size = '115, 22'
        $toolstripItemListView.Text = 'List View'
        $toolstripItemListView.add_Click($toolstripItemListView_Click)
        #
        # toolstripItemTileView
        #
        $toolstripItemTileView.Name = 'toolstripItemTileView'
        $toolstripItemTileView.Size = '152, 22'
        $toolstripItemTileView.Text = 'Tile View'
        $toolstripItemTileView.add_Click($toolstripItemTileView_Click)
        $menustrip1.ResumeLayout()
        $formMiniExplorer.ResumeLayout()

        #Save the initial state of the form
        $InitialFormWindowState = $formMiniExplorer.WindowState
        #Init the OnLoad event to correct the initial state of the form
        $formMiniExplorer.add_Load($Form_StateCorrection_Load)
        #Clean up the control events
        $formMiniExplorer.add_FormClosed($Form_Cleanup_FormClosed)
        #Show the Form
        return $formMiniExplorer.ShowDialog()

    } #End Function

    #Call the form
    Show-miniExplorer_psf | Out-Null
    return $selectedItem
}
